import React, { useState } from 'react';
import "./CarsButtons.css";
import CarInstance from './CarInstance'
import Car8 from "./img/image8.jpeg"


export const AvailButton = () => {
  const [cars, setCars] = useState([]);

  useEffect(() => {
    getCars();
  }, []);

  // Function to fetch cars based on status
  const getCarsByStatusAvail = () => {
    fetch(`/getByStatusAvail`)
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then((data) => {
        setCars(data);
      })
      .catch((error) => {
        console.error('There was a problem fetching the cars:', error);
      });
  };

  return (
    <div className="my-4 d-flex justify-content-center">
      <button className="car-status-button mx-2" onClick={() => getCarsByStatusAvail}>available</button>
      {/* // <button className="car-status-button mx-2" onClick={() => getCarsByStatus('Unavail')}>unavailable</button> */}

      {/* Render the cars */}
      {cars.map((car) => (
                    <CarInstance
                        key={car.car_id}
                        strMark={car.mark}
                        strPrice={car.price.toString()}
                        strImagePath={Car8}
                    />
                ))}
    </div>
  );
};
